import React from "react";
// import $ from 'jquery';
import {Link} from 'react-router-dom';



const Sidebar = () => {
    return(
   <div>
       <header className="header" id="header">
        <div className="header_toggle"><i id="header-toggle" className="fas fa-bars text-white"></i> </div>
        <div className="header_img"> </div>
    </header>
    <div className="l-navbar" id="nav-bar">
        <nav className="nav">
            <div> <Link to="#" className="nav_logo"><i className="fas fa-angry"></i> <span className="nav_logo-name">Example</span> </Link>
                <div className="nav_list"> <Link to="#" className="nav_link active"> <i className="fab fa-angellist"></i> <span className="nav_name">Dashboard</span> </Link> <Link to="#" className="nav_link"> <i className="fas fa-anchor"></i> <span className="nav_name">Stats</span> </Link> <Link className="nav_link nav-link dropdown-toggle" to="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false"> <i className="fas fa-award"></i> <span className="nav_name">Dropdown</span> </Link>
                    <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
                        <li><Link className="dropdown-item" to="#">Action</Link></li>
                        <li><Link className="dropdown-item" to="#">Another action</Link></li>
                        <li>

                        </li>
                        <li><Link className="dropdown-item" to="#">Something else here</Link></li>
                    </ul>
                </div>
            </div> <Link to="#" className="nav_link"> <i className='bx bx-log-out nav_icon'></i> <span className="nav_name">SignOut</span> </Link>
        </nav>
    </div>

    <div className="height-100 bg-light">
        <h4>Content HERE</h4>
    </div>
   </div>

    );
}

export default Sidebar;
